  /**
   *
   * @param el
   * @returns {*}
   */
  var getSelection = function (el) {
    var result = {};


    if (el && el.getAttribute('contenteditable')) {
      // console.log(el.dataset.rangeIndex,el);
      var range = wdtEmojiBundle.ranges[parseInt(el.dataset.rangeIndex)];
      console.log(range);
      // return {
      //   el: el,
      //   ce: true
      // }
      var val = $(el)[0].textContent;
      return {
        "el"   : el,
        "element"   : range.element,
        "start": range ? range.startOffset : 0,
        "end"  : range ? range.endOffset : 0,
        "len"  : val.length,
        "sel"  : val.substring(range.startOffset, range.endOffset),
        "contenteditable" : true
      };
    }

    if (window.getSelection) {
      var val = el.value || el.innerHTML,
        len = val.length,
        start = el.selectionStart,
        end = el.selectionEnd,
        sel = val.substring(start, end);

      result = {
        "el"   : el,
        "start": start,
        "end"  : end,
        "len"  : len,
        "sel"  : sel
      };
    } else if (document.selection) {
       // ie should remove this piece
      var range = document.selection.createRange(),
        value = el.value || el.innerHTML,
        stored_range = range.duplicate();

      stored_range.moveToElementText(el);
      stored_range.setEndPoint('EndToEnd', range);
      el.selectionStart = stored_range.text.length - range.text.length;
      el.selectionEnd = el.selectionStart + range.text.length;

      result = {
        "el"   : el,
        "start": el.selectionStart,
        "end"  : el.selectionEnd,
        "len"  : value.length,
        "sel"  : range.text
      };
    }

    return result;
  };

